import React from "react";
import Header from "./ui/header";
import { ThemeProvider } from "@mui/material/styles";

import theme from "./ui/theme";
import { CssBaseline } from "@mui/material";
import { BrowserRouter, Route, Routes } from "react-router-dom";

type helperProps = {
  title: string;
};

const HelperComponent: React.FC<helperProps> = ({ title }) => {
  return <div>Home</div>;
};

const App: React.FC = () => {
  return (
    <ThemeProvider theme={theme}>
      <BrowserRouter>
        <CssBaseline />
        <Header />
        <Routes>
          <Route path='/' element={<HelperComponent title='home' />} />
          <Route
            path='/services'
            element={<HelperComponent title='services' />}
          />
          <Route
            path='/customsoftware'
            element={<HelperComponent title='customsoftware' />}
          />
          <Route
            path='/mobileapps'
            element={<HelperComponent title='mobileapps' />}
          />
          <Route
            path='/websites'
            element={<HelperComponent title='websites' />}
          />
          <Route
            path='/revolution'
            element={<HelperComponent title='revolution' />}
          />
          <Route path='/about' element={<HelperComponent title='about' />} />
          <Route
            path='/contact'
            element={<HelperComponent title='contact' />}
          />
          <Route
            path='/estimate'
            element={<HelperComponent title='estimate' />}
          />
        </Routes>
      </BrowserRouter>
    </ThemeProvider>
  );
};

export default App;
